import { Component, OnInit } from '@angular/core';
import { SearchMapBoxService } from 'src/app/Services/search-map-box.service';

@Component({
  selector: 'app-testytest',
  templateUrl: './testytest.component.html',
  styleUrls: ['./testytest.component.css']
})
export class TestytestComponent implements OnInit {
  /**
   *
   */
  constructor(private searchMapBoxService: SearchMapBoxService) {
    
  }
  ngOnInit(): void {
    this.getSearchResults();
    this.getClickedResults();
  }

  getSearchResults() {
    this.searchMapBoxService.getSearchResults("search")
      .subscribe(result => {
          console.log(result);
      });
  }

  getClickedResults() {
    this.searchMapBoxService.getClickedResults("")
    .subscribe(result => {
        console.log(result);
    });
  }


}
